import * as c from "./Calc" 
import React from 'react';

function Calculate()
{
return(
<h1>{c.Add(10,10)}</h1>,
<h1>{c.Sub(10,10)}</h1>,
<h1>{c.Mul(10,20)}</h1>,
<h1>{c.Divi(10,3)}</h1>
);
}

export default Calculate;
